# pipeline function : the pipeline function is the most high level api of the hugging face
# library, this regroups together all the steps to go from raw text to usable output

from transformers import pipeline

# sentiment analysis

classifier = pipeline("sentiment-analysis")

classifier(["I wanted to learn hugging face since long, I am happy that i finally got into it",
"I really hate why i delay every useful stuff in life"])

# zero shot classification pipeline is more general form of classification stuff

classifier = pipeline("zero-shot-classification")

classifier(["Modi is the greatest leader in the world currently", "Kolhi's agreesion is worth seeing"], candidate_labels = ["Education", "Sport", "Politics"])

# text generation

