# TOKENIZER

# there are three type of tokenizer: word based, character based and
# subword based. Most of the state of art performance have been obtained
# on subword based tokenization. The three famous subword based
# tokenizations are WordPiece (BERT, DistilBERT), Unigram (XLNET, ALBERT),
# Bite-pair encoding (GPT-2, RoBERTa)

# here we learn tokenizer pipeline

tokenizer = AutoTokenizer.from_pretrained("bert-base-uncased")
tokenizer(["My name is Prabhat"], padding = True, truncation = True, return_tensors = "pt")


# we can break it down to get the tokenized subwords and their tokens too
tokens = tokenizer.tokenize("My name is Prabhat")
input_ids = tokenizer.convert_tokens_to_ids(tokens)
print(input_ids)

tokenizer = AutoTokenizer.from_pretrained("albert-base-v1")
tokenizer(["My name is Prabhat"], padding = True, truncation = True, return_tensors = "pt")


# we can break it down to get the tokenized subwords and their tokens too
