input_ids = tokenizer.convert_tokens_to_ids(tokens)
print(input_ids)

# we can also decode tokenized sentences

tokenizer.decode(input_ids)

# we observe that the tokenized stuff is not same as before, there was some
# standard intial and last token there like 101, which meant start fo senetence,
#  that can be doen by prepare_for_model method
tokenizer.prepare_for_model(input_ids)

